import React from 'react';
import AccountNav from '../layout/AccountNav';

const randomValue = (max = 10000, min = 0) => {
  return Math.random() * (max - min) + min;
};

export const Account = () => {
  return (
    <div>
      <AccountNav />
      <div className='container'></div>
    </div>
  );
};

export default Account;
